 const[post,setUserPost]= useState({
userId:'',
id:'',
title:'',
body:''
});





  const showPost = async () => {

    const res =   await fetch(`https://jsonplaceholder.typicode.com/posts?userId=${id}`)
    const post = await res.json();
    setUserPost(post)
    console.log(post)

  };

  useEffect(() => {
    showPost();
  }, []);


  return(
    <>
 <UserPost userpost={post} />

    </>
